import React, { Component } from 'react'

import { Segment } from 'semantic-ui-react';


class WildPokemonMap extends Component {
    constructor(props) {
        super(props);

        this.state = {
            kantoRand: []
        }
    }

    render() {
        return (
            <div>
                <Segment id='map'>

                </Segment>       

                <Segment>
                    <button
                        onClick={this.props.renderRandomPoke}>
                        Refresh
                    </button>
                </Segment>
            </div>
        )
    }
}

export default WildPokemonMap
